import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
    const title = props.expense.title;
    const amount = props.expense.amount;
    const date = props.expense.date;

  return (
    <div className="Expenses">
      <ExpenseItem
        title={title}
        amount={amount}
        date={date}
      />
      <ExpenseItem
        title={title}
        amount={amount}
        date={date}
      />
      <ExpenseItem
        title={title}
        amount={amount}
        date={date}
      />
      <ExpenseItem
        title={title}
        amount={amount}
        date={date}
      />
    </div>
  );
}

export default Expenses;
